import React from 'react';

export default function DriverList({drivers}){
  return (
    <div style={{border:'1px solid #ddd', padding:16, borderRadius:8}}>
      <h3>Available Drivers</h3>
      {(!drivers || drivers.length===0) && <p>No drivers available</p>}
      <ul style={{listStyle:'none', padding:0}}>
        {(drivers || []).map(d=> (
          <li key={d.id} style={{padding:8, borderBottom:'1px solid #eee'}}>
            <strong>{d.name}</strong> — {d.experience} yrs — License: {d.licenseType}
            <div>Hourly: ₹{d.hourlyRate}</div>
          </li>
        ))}
      </ul>
    </div>
  );
}
